import React from 'react'
interface AgeCartComponentProps {
    value: number;
    index: number;
    onHandleAgeChange: (value: number) => void;
}
export const AgeCartComponent: React.FC<AgeCartComponentProps> = ({ value, index, onHandleAgeChange }) => {
    return (
        <div className='AgeCartComponent'>
            <select
                name="age"
                id="age"
                value={value}
                onChange={(e) => onHandleAgeChange(Number(e.target.value))}
            >
                <option value=""> Select Child{index}Age</option>
                {[...Array(18)].map((_, index) => (
                    <option
                        value={value}
                    >{index}
                    </option>
                ))}
            </select>
        </div>
    )
}
